    XW += x[44]*66.059940; /*H2C4O */
    XW += x[45]*69.083850; /*CH2CHCHCHO */
    XW += x[46]*170.341020; /*NC12H26 */
    XW += x[47]*169.333050; /*SXC12H25 */
    XW += x[48]*168.325080; /*C12H24 */
    XW += x[49]*167.317110; /*PXC12H23 */
    XW += x[50]*140.270900; /*C10H20 */
    XW += x[51]*139.262930; /*PXC10H19 */
