    double refC = 101325 / 8.31451 / T;

    /*reaction 1: H + O2 (+M) <=> HO2 (+M) */
    kc[0] = 1.0 / (refC) * exp((g_RT[0] + g_RT[6]) - (g_RT[3]));

    /*reaction 2: CO + H2 (+M) <=> CH2O (+M) */
